import React, { useEffect, useRef } from 'react';
import Cube from '../components/Cube';
import { Link } from 'react-router-dom';
import './css/Home.css';
import laptopCode from '../assets/images/laptopCode.jpg';

const Home = () => {
  const startX = useRef(0);
  const startY = useRef(0);

  useEffect(() => {
    const animateLetters = () => {
      const letters = document.querySelectorAll('.title-container h1 span');

      letters.forEach((letter, index) => {
        setTimeout(() => {
          letter.style.opacity = 1;
          letter.style.transform = 'translateX(0)';
        }, 100 * index);
      });
    };

    animateLetters();

    const cube = document.querySelector('.cube');
    let isClockwise = true;

    const handleClick = () => {
      if (isClockwise) {
        cube.classList.remove('rotate-clockwise');
        cube.classList.add('rotate-counterclockwise');
      } else {
        cube.classList.remove('rotate-counterclockwise');
        cube.classList.add('rotate-clockwise');
      }
      isClockwise = !isClockwise;
    };

    const handleTouchStart = (e) => {
      const touch = e.touches[0];
      startX.current = touch.clientX;
      startY.current = touch.clientY;
    };

    const handleTouchEnd = (e) => {
      const touch = e.changedTouches[0];
      const endX = touch.clientX;
      const endY = touch.clientY;
      const diffX = endX - startX.current;
      const diffY = endY - startY.current;

      if (Math.abs(diffX) > Math.abs(diffY)) {
        if (diffX > 0) {
          cube.classList.remove('rotate-counterclockwise');
          cube.classList.add('rotate-clockwise');
        } else {
          cube.classList.add('rotate-counterclockwise');
          cube.classList.remove('rotate-clockwise');
        }
      } else {
        if (diffY > 0) {
          cube.classList.remove('rotate-counterclockwise');
          cube.classList.add('rotate-clockwise');
        } else {
          cube.classList.add('rotate-counterclockwise');
          cube.classList.remove('rotate-clockwise');
        }
      }
    };

    cube.addEventListener('click', handleClick);
    cube.addEventListener('touchstart', handleTouchStart);
    cube.addEventListener('touchend', handleTouchEnd);

    return () => {
      cube.removeEventListener('click', handleClick);
      cube.removeEventListener('touchstart', handleTouchStart);
      cube.removeEventListener('touchend', handleTouchEnd);
    };
  }, []);

  return (
    <div className="custom-container">
      <header>
        <div className="title-container">
          <h1>
            <span>S</span>
            <span>o</span>
            <span>f</span>
            <span>t</span>
            <span className='blood'>D</span>
            <span>r</span>
            <span>a</span>
            <span>k</span>
            <span>u</span>
            <span>l</span>
            <span>a</span>
            <span>&copy</span>
          </h1>
          <h2>Your Gateway to the Digital Excellence</h2>
        </div>
      </header>
      <main>
        <Cube />
        <div className="custom-nav">
          <ul className="custom-menu">
            <li><Link to="/about">About</Link></li>
            <li><Link to="/projects">Projects</Link></li>
            <li><Link to="/contact">Contact</Link></li>
          </ul>
        </div>
        <div className="custom-content">
          <h1>Main Content Title</h1>
          <h2>Subtitle</h2>
          <p className="tagline">A creative tagline goes here.</p>
        </div>
      </main>
      <footer>
        <p>&copy; 2024 Caveira Hippie. All rights reserved.</p>
      </footer>
    </div>
  );
};

export default Home;
